// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;



contract Profile {


    struct Bio {
        string firstName;
        string middleName;
        string lastName;
        string email;
        string phone;
        string profileImage;
        address userAddress;
    }
    mapping (address => Bio) public  profile;

    
    // struct Skill {
    //     array frontend;
    //     array backend;
    //     array framework;
    // }
    // mapping (address => Skill) public  skill;



    function addBio(string memory firstName, string memory middleName, string memory lastName, string memory email, string memory phone, string memory profileImage) public {

        if(msg.sender == profile[msg.sender].userAddress){
            delete profile[msg.sender];
        }   
        profile[msg.sender].firstName = firstName;
        profile[msg.sender].middleName = middleName;
        profile[msg.sender].lastName = lastName;
        profile[msg.sender].email = email;
        profile[msg.sender].phone = phone;
        profile[msg.sender].profileImage = profileImage;
        profile[msg.sender].userAddress = msg.sender;
       
    }

    function delProfile() public {
        delete profile[msg.sender];
    }

  
}

